INSERT INTO `tb_dialogue_content` VALUES (10001,1,1,'0',0,'0',0,0,'话说我真的不是在做梦么？','','',0,'','',0),(10001,2,22014,'小仙女',1,'wanshenggongzhu',0,0,'别发呆啦！观音姐姐让我带你来接受众神的挑战……','','',0,'','',0),(10001,3,1,'0',0,'0',0,0,'啊！你是谁？你又是从哪里冒出来的？','','',0,'','',0),(10001,4,22014,'小仙女',1,'wanshenggongzhu',0,0,'这是个秘密……你叫我小仙女就好啦~赶紧跟我走吧！','','',0,'','',0),(10002,1,1,'0',0,'0',0,0,'啊！和会说话的猴子一起的会说话的猪，你们也来到天庭啦？','','',0,'','',0),(10002,2,23073,'猪八戒',1,'zhubajie',0,0,'别看我这样，我前世可是英气逼人的天蓬元帅……来吧，让我看看你的实力！','','',0,'','',0),(10003,1,1,'0',0,'0',0,0,'神仙果然不是吃素的，小仙女，我快hold不住了~~~~','','',0,'','',0),(10003,2,22014,'小仙女',1,'wanshenggongzhu',0,0,'哎，真是没办法~那我就勉为其难的帮你一下吧~','','',0,'','',0),(10003,3,0,'',0,'',0,0,'','','',1,'0,30194,0,0,0,0','0,10100,0,0,0,0',0),(10010,1,23096,'观音',1,'guanyin',0,0,'呃……虽然你的功力还是很low但是我觉得打那几个小怪应该没问题了~','','',0,'','',0),(10010,2,1,'0',0,'0',0,0,'这么直白的说出来真的好伤自尊啊神仙姐姐~','','',0,'','',0),(10010,3,23096,'观音',1,'guanyin',0,0,'对了，在救阎罗之前，你还有一件重要的事情要做。','','',0,'','',0),(10010,4,23096,'观音',1,'guanyin',0,0,'嫦娥仙子被魔主那妖孽封印了，只有拥有“混沌体”之力的你才能解开。','','',0,'','',0),(10010,5,1,'0',0,'0',0,0,'说半天还是要我跑腿呀~','','',0,'','',0),(10010,6,23096,'观音',1,'guanyin',0,0,'嫦娥仙子可是很好的战力。快去吧，时间不多了！','','',0,'','',0),(10011,1,1,'0',0,'0',0,0,'我……这么快就到平顶山啦？','','',0,'','',0),(10011,2,22014,'小仙女',1,'wanshenggongzhu',0,0,'这就是跟神仙混的好处啊~~小心！妖怪来了！','','',0,'','',0),(10020,1,1,'0',0,'0',0,0,'哇啊啊！出来了一个更老的妖怪！','','',0,'','',0),(10020,2,23002,'金角大王',1,'jinjiao',0,0,'不可饶恕啊！伤了这么多我的孩子！去死吧！！','','',0,'','',0),(10021,1,23002,'金角大王',1,'jinjiao',0,0,'想不到普通攻击居然对你没什么效果……哼，让你见识见识我真正的力量！','','',0,'','',0),(10021,2,0,'',0,'',0,0,'','Boss.BossStar','fight3',2,'0,30301,0,0,0,0','0,40025,0,0,0,0',0),(10021,3,1,'0',0,'0',0,0,'哇啊啊！居然变大了？好恐怖啊~~~','','',0,'','',0),(10021,4,22014,'小仙女',1,'wanshenggongzhu',0,0,'我和我的小伙伴们都惊呆了！','','',0,'','',0),(10022,1,23083,'阎罗',1,'yanluowang',0,0,'居然赢了……这就是“混沌体”的力量么？','','',0,'','',0),(10022,2,1,'0',0,'0',0,0,'小丫头，没事了。哈哈哈~','','',0,'','',0),(10022,3,23083,'阎罗',1,'yanluowang',0,0,'我不是小丫头啦！！！','','',0,'','',0),(10023,1,1,'0',0,'0',0,0,'神仙姐姐我回来啦！咦？姐姐为何发愁？','','',0,'','',0),(10023,2,23096,'观音',1,'guanyin',0,0,'悟空需要留在天庭恢复，但又牵挂他花果山的猴子猴孙。','','',0,'','',0),(10023,3,1,'0',0,'0',0,0,'虽然妖怪打不过，但这种跑腿的小事，我去就行勒~~','','',0,'','',0),(10024,1,1,'0',0,'0',0,0,'咦？这些鬼鬼祟祟的人好眼熟！','','',0,'','',0),(10024,2,21004,'黄巾刀兵',1,'huangjindaobing',0,0,'天堂有路你不走，地狱无门你自来~把这山头当你家后花园了？','','',0,'','',0),(10024,3,1,'0',0,'0',0,0,'天庭？地府？嘿~我还都去过！','','',0,'','',0),(10024,4,1,'0',0,'0',0,0,'话说你怎么穿的和黄巾贼子似的？（难道现在猴子都玩cosplay？）','','',0,'','',0),(10024,5,21004,'黄巾刀兵',1,'huangjindaobing',0,0,'你才是贼子！你全家都是贼子！','','',0,'','',0),(10025,1,22003,'张梁',1,'zhangliang',0,0,'我抽你个死人头，没钱交保护费，还练什么兵，打什么仗！还想不想在我大营里混了？','','',0,'','',0),(10025,2,1,'0',0,'0',0,0,'喂喂喂，做人干嘛那么认真、冲动呢？何况他只是个小兵！','','',0,'','',0),(10025,3,22003,'张梁',1,'zhangliang',0,0,'你是从哪里“嗖”的一声出来的？保护费交了么？','','',0,'','',0),(10026,1,22004,'张宝',1,'zhangbao',0,0,'话说劳资我当年，从九华山砍到东海湾，砍了三天三夜，眼睛都没眨一下！','','',0,'','',0),(10026,2,1,'0',0,'0',0,0,'你眼睛不干吗？','','',0,'','',0),(10026,3,22004,'张宝',1,'zhangbao',0,0,'我TM说我杀人不眨眼，你TM问我眼睛干不干？','','',0,'','',0),(10027,1,1,'0',0,'0',0,0,'看来黄巾贼子真的复活了！连张角都出现了！？','','',0,'','',0),(10027,2,22003,'张角',1,'zhangjiao',0,0,'生又何哀，死又何苦，等你明白了舍生取义，你自然会回来跟我唱这首歌的！','','',0,'','',0),(10027,3,1,'0',0,'0',0,0,'唱歌？唱什么歌！？','','',0,'','',0),(10027,4,22003,'张角',1,'zhangjiao',0,0,'看！就是这《儿歌三百首》~','','',0,'','',0),(10027,5,22003,'张角',1,'zhangjiao',0,0,'Only you……','','',0,'','',0),(10027,6,1,'0',0,'0',0,0,'“噢”你个头啊！','','',0,'','',0),(10028,1,23094,'紫霞仙子',1,'zixiaxianzi',0,0,'臭道士！居然在花果山乱丢垃圾！！！No zuo no die why you try!','','',0,'','',0),(10028,2,22003,'张角',1,'zhangjiao',0,0,'……我做了什么？','','',0,'','',0),(10028,3,1,'0',0,'0',0,0,'啊，这位仙子姐姐，是来助阵的么？','','',0,'','',0),(10028,4,23094,'紫霞仙子',1,'zixiaxianzi',0,0,'嘿，顺手人情~臭道士接招！','','',0,'','',0),(10028,5,0,'',0,'',0,0,'','','',1,'30147,30158,30148,30150,0,30153','10020,10127,10020,10020,0,10020',0),(10030,1,23094,'紫霞仙子',1,'zixiaxianzi',0,0,'悟空居然不在这里……','','',0,'','',0),(10030,2,23094,'紫霞仙子',1,'zixiaxianzi',0,0,'我猜中了开头，却猜不中这结局。','','',0,'','',0),(10030,3,1,'0',0,'0',0,0,'别伤感……悟空在天庭呢~','','',0,'','',0),(10030,4,23094,'紫霞仙子',1,'zixiaxianzi',0,0,'我要乘风归去了，谢谢！','','',0,'','',0),(10030,5,1,'0',0,'0',0,0,'真是风一般的女纸啊~~~~~','','',0,'','',0),(10030,6,1,'0',0,'0',0,0,'居然能遇到黄巾贼……那会不会遇到各位将军呢？','','',0,'','',0),(10030,7,1,'0',0,'0',0,0,'还是先回去找神仙姐姐问问吧。','','',0,'','',0),(10031,1,1,'0',0,'0',0,0,'神仙姐姐，我在花果山遇到了一些已经死了但又活了的老乡……','','',0,'','',0),(10031,2,23096,'观音',1,'guanyin',0,0,'老乡见老乡，打架没商量！','','',0,'','',0),(10031,3,1,'0',0,'0',0,0,'……','','',0,'','',0),(10031,4,23096,'观音',1,'guanyin',0,0,'咳（严肃）！','','',0,'','',0),(10031,5,23096,'观音',1,'guanyin',0,0,'掐指一算……天机果然难测……','','',0,'','',0),(10031,6,1,'0',0,'0',0,0,'……会遇到很多熟人么？（虽然他们不熟我……）','','',0,'','',0),(10031,7,23096,'观音',1,'guanyin',0,0,'咳咳……前方凶险难测，你却还带着这把烂剑？不忍直视啊~~~','','',0,'','',0),(10031,8,23096,'观音',1,'guanyin',0,0,'东海龙宫宝贝甚多，你前往讨要几件吧！','','',0,'','',0),(10031,9,1,'0',0,'0',0,0,'宝贝~~（吞口水）','','',0,'','',0),(10032,1,1,'0',0,'0',0,0,'观音姐姐让我来找龙王讨要点顺手兵器，但这个龙王要到何处去寻？','','',0,'','',0),(10032,2,21008,'蟹将',1,'xiejiang',0,0,'大胆狂徒，居然擅闯龙宫！','','',0,'','',0),(10032,3,22014,'小仙女',1,'wanshenggongzhu',0,0,'蟹将来了，龙王还会远么？','','',0,'','',0),(10034,1,22005,'龟丞相',1,'guichengxiang',0,0,'想不到居然一路闯到这，有两把刷子！','','',0,'','',0),(10034,2,22005,'龟丞相',1,'guichengxiang',0,0,'就让老夫来领教一下吧~','','',0,'','',0),(10034,3,1,'0',0,'0',0,0,'我去，怎么一个个都这么彪悍呢？','','',0,'','',0),(10035,1,22005,'龟丞相',1,'guichengxiang',0,0,'哎哟哟~好厉害的人！','','',0,'','',0),(10035,2,22005,'龟丞相',1,'guichengxiang',0,0,'难道你是那伙强人的同伙？速速禀报太子爷！','','',0,'','',0),(10035,3,1,'0',0,'0',0,0,'那伙强人？难道还有其他人？','','',0,'','',0),(10036,1,1,'0',0,'0',0,0,'喂，我只是受观音姐姐指引来找东海龙王讨要顺手兵器的，为何百般阻拦？','','',0,'','',0),(10036,2,21008,'蟹将',1,'xiejiang',0,0,'嘶……杀…………','','',0,'','',0),(10036,3,22014,'小仙女',1,'wanshenggongzhu',0,0,'这些家伙神情有点不对……','','',0,'','',0),(10037,1,22006,'龙太子',1,'longtaizi',0,0,'来者何人？居然敢打伤我龙宫护卫，还不快快束手就擒！看招！','','',0,'','',0),(10037,2,1,'0',0,'0',0,0,'……做人不要冲动。','','',0,'','',0),(10038,1,22006,'龙太子',1,'longtaizi',0,0,'居然被打败了……好丢脸~','',''