,'','',0),(10285,1,23077,'六耳猕猴',1,'LiuErMiHou',0,0,'混沌体，我要代表魔主消灭你！','','',0,'','',0),(10285,2,1,'0',0,'0',0,0,'哼，都是我手下败将，猖狂什么？','','',0,'','',0),(10285,3,23077,'六耳猕猴',1,'LiuErMiHou',0,0,'之前是魔主让我们活捉你，不能伤害你，现在的命令是毁灭你，终于可以放开手脚了，你觉得你还有胜算么？','','',0,'','',0),(10285,4,1,'0',0,'0',0,0,'不试试怎么知道！','','',0,'','',0),(10286,1,23077,'六耳猕猴',1,'LiuErMiHou',0,0,'居然有人可以在短短时间内功力增加这么大……','','',0,'','',0),(10286,2,1,'0',0,'0',0,0,'也许是因为我不是个普通人吧，我可是让魔主头疼的混沌体呢！','','',0,'','',0),(99999,1,1,'0',0,'0',0,0,'糟了，睡过头了……诶？这是什么鬼地方？','','',0,'','',0),(99999,2,23009,'白骨精',1,'baigujing',0,0,'赶紧抓住“混沌体”，不要让他跑了！','','',0,'','',0),(99999,3,1,'0',0,'0',0,0,'（惊）妖…（捂嘴）几位大仙，早啊……','','',0,'','',0),(99999,4,23072,'孙悟空',1,'wukong',0,0,'保护好“混沌体”，落到他们手里就完了！','','',0,'','',0),(99999,5,0,'',0,'',0,0,'','','',1,'30136,30394,30135,30133,0,30395','998,998,998,998,998,998',0),(99999,6,23009,'白骨精',1,'baigujing',0,0,'至尊宝，快把“混沌体”交给我！','','',0,'','',0),(99999,7,23071,'唐僧',1,'tangseng',0,0,'这位女施主，世界如此美好，你却如此暴躁，这样不好，不好……','','',0,'','',0),(99999,8,23009,'白骨精',1,'baigujing',0,0,'唐三藏，你的罗嗦我早就听说过了，看招！','','',0,'','',0),(100001,1,1,'0',0,'0',0,0,'这是个怎样的世界？一定是我睡醒的姿势不对……','','',0,'','',0),(100001,2,23083,'阎罗',1,'yanluowang',0,0,'如今黄泉已被妖魔掌控，我们先带“混沌体”离开……','','',0,'','',0),(100001,3,30161,'魔主',1,'mozhu',0,0,'我在旁边这么久了你们当我是不存在么？','','',0,'','',0),(100004,1,1,'0',0,'0',0,0,'这是什么恐怖的力量？！怎么只剩下小丫头你了？','','',0,'','',0),(100004,2,23083,'阎罗',1,'yanluowang',0,0,'不行，魔主太厉害了……咳咳咳…我用剩下不多的力量送你到安全的地方吧……','','',0,'','',0),(100004,3,1,'0',0,'0',0,0,'那你呢？“混沌体”又是什么？','','',0,'','',0),(100004,4,23083,'阎罗',1,'yanluowang',0,0,'走！！！！','','',0,'','',0),(100005,1,1,'0',0,'0',0,0,'啊！这是神马地方？我瞬移了么？呃，这位大姐，请问这里是哪？','','',0,'','',0),(100005,2,23096,'观音',1,'guanyin',0,0,'大姐！（怒）(╯‵□′)╯︵┻━┻！这里是天庭，对你们凡人来说，就是神仙住的地方！','','',0,'','',0),(100005,3,1,'0',0,'0',0,0,'啊！神仙！！我见到神仙了！！！神仙姐姐，那你一定有办法救那位送我来这里的小丫头吧？','','',0,'','',0),(100005,4,23096,'观音',1,'guanyin',0,0,'你说的阎罗吧？你现在连个小妖都打不过，更别说救阎罗了……我看你还是先找几位神仙点拨一下吧~','','',0,'','',0);
